dataset.description:
Dataset ini berisi tentang Indeks Tata Kelola Pengadaan Minimal Baik terdiri atas 3 (tiga) indikator dengan bobot penilaian sebagai berikut: 
1. Pemanfaatan sistem pengadaan : a. SiRUP (10%); b. E-Tendering (5%); c. E-Purchasing (5%); d. Non-E-Tendering & Non-E-Purchasing (5%); dan e. E-Kontrak (5%); 
2. Kualifikasi dan kompetensi SDM PBJ (30%); 
3. Tingkat Kematangan BPPBJ (40%).
 
Berdasarkan SE Kepala LKPP RI No. 4 Tahun 2021 Kategori: 
1. Predikat Istimewa dengan nilai 100; 
2. Predikat Sangat Baik dengan rentang nilai >90 s.d. <100; 
3. Predikat Baik dengan rentang nilai >70 s.d. 90; 
4. Predikat Cukup dengan rentang nilai >= 50 s.d. 70; 
5. Predikat Kurang dengan nilai <50. 

Berdasarkan SE Kepala LKPP No. 4 Tahun 2021 tentang Penjelasan Indeks Tata Kelola Pengadaan Minimal Baik Sebagai Aspek Indikator 'antara' Dalam Indeks Reformasi Birokrasi.
